@dev Calculate the required input amount and the maximum output amount for a given swap path.
This function mimics the logic of the buy function for each step of the path, ensuring that the
swapping process adheres to all the constraints (withdrawal limits, depth, deposit limits) of each
individual pool.
@param path An array of tokens representing the swap path. Consecutive tokens indicate trading pairs.
@return amountInRequired The total amount of the first token in the path required for the swap.
@return amountOutMax The maximum amount of the last token in the path received from the swap.
